#include<iostream>
#include<string>
#include<vector>
#include<map>
using std::string;
using std::vector;
using std::map;

vector<string> findRepeatDnaSequences(string s){
    int n = s.length();
    vector<string> answer;
    if (n<10) return answer;
    map<string,bool> store;
    for (int i=0;i<n-10;i++){
        string temp = s;
        bool count = false;
        temp.erase(temp.begin(),temp.begin()+i);
        temp.erase(temp.begin()+10,temp.end());
        if (store.find(temp)!=store.end()) continue;
        for (int j=i+1;j<=n-10;j++){
            bool check = true;
            for (int k=0;k<10;k++) {
                if (s[j+k]!=temp[k]) {
                    check = false;
                    break;
                }
            }
            if (!check) continue;
            count = true;
            store[temp] = true;
            break;
        }
        if (count) answer.push_back(temp);
        else store[temp] = false;
    }
    return answer;
}

int main(){
    string s = "";
    vector<string> answer = findRepeatDnaSequences(s);
    for (auto val : answer) std::cout<<val<<" ";
    std::cout<<std::endl;
    return 0;
}